import { Link } from "react-router-dom";

export function Navbar(){
    return (
        <nav>
            <Link to="/feed" style={{padding:"15px", border:"5px"}}>PostFeed</Link>
            <Link to="/login" style={{padding:"15px", border:"5px"}}>Login</Link>
            <Link to="/" style={{padding:"15px", border:"5px"}}>SignUp</Link>
            <Link to="/:user" style={{padding:"15px", border:"5px"}}>ViewPost</Link>
            {/** <Link to="/viewpost/:postid" style={{padding:"15px", border:"5px"}}>ViewPost</Link> */}
        </nav>
    )
}
